import React from 'react'
import './Task.css';

export default function Task({task}) {
    const deadline = task.dueDate.toLocalString().sp
    return (
        <div className ="task-block">
            <h1 className="title">{task.title}</h1>
            <div className="description">{task.desc}</div>
            <input type="checkbox"/>
            <div>{deadline}</div>

        </div>
    )
}
